import React from 'react';
import './Portfolio.css';

const Portfolio = () => {
    return (
        <section id="portfolio" className="portfolio">
            <h2>Portfolio</h2>
            <div className="triangle-chart">
                <a href="https://example.com/project1" target="_blank" rel="noopener noreferrer" className="slice slice-1">
                    <h3>Project 1</h3>
                    <p>View Project</p>
                </a>
                <a href="https://example.com/project2" target="_blank" rel="noopener noreferrer" className="slice slice-2">
                    <h3>Project 2</h3>
                    <p>View Project</p>
                </a>
                <a href="https://example.com/project3" target="_blank" rel="noopener noreferrer" className="slice slice-3">
                    <h3>Project 3</h3>
                    <p>View Project</p>
                </a>
            </div>
        </section>
    );
};

export default Portfolio;
